public class GraterNumber {
	public static Boolean greaterNum(int num)
	   {
		   return (num>100 && num >200 );               
	   }
	   
		public static void main(String[] args) {
			// TODO Auto-generated method stub
	          
			System.out.println(greaterNum(205));
			
		}
}
